const containerStzle = {
    display: "flex",
    alignItems: "center",
    gap: "16px",
};

const ContainerStyle = {
    display: "flex",
    gap: "4px",
};

const textStyle = {
    linghHeight: "0",
    margin: "0",
};

export default function StartRating() {
   
   
    return (
        <div style={containerStzle}>
            <div style={ContainerStyle}>
                {Array.from({ length: 5 }, (_, i) =>
                (<span key={i}>S{i + 1}</span>
                    
                    ))}
            </div>
            <p style={textStyle}>10</p>
        </div>
    );

}
